import React from 'react'
import classes from  "./Footer.module.css";

const sampleData = [
    {
      name: "Facebook",
      url: "#",
      icons: "https://img.icons8.com/material/48/000000/facebook--v1.png",
    },
    {
      name: "LinkedIn",
      url: "#",
      icons: "https://img.icons8.com/material-rounded/48/000000/linkedin--v1.png",
    },
    {
      name: "Instagram",
      url: "#",
      icons:"https://img.icons8.com/material/48/000000/instagram-new--v1.png",
    },
  ];

const Footer = () => {
    return (
       <div className = {classes.container}>

           <h1 className = {classes.left}>Left</h1>
           <div className = {classes.right}>
               <h2>Connect with us </h2>
               <h2>1.800.701.3082</h2>
               <h2>Follow us on</h2>
                <div id="social-media">
                    {sampleData.map((data,index) => (<a href={data.url} key={index}><img className="social-media-logo"src={data.icons} title={data.name}></img></a>))}
        </div></div>
       </div>
    )
}

export default Footer
